INSERT INTO `newsupdates` VALUES (1,'','this is news 10','2020-09-08 09:47:25'),(21,'','Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry\'s standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book. It has survived not only five centuries, but also the leap into electronic typesetting','2020-09-08 09:51:47'),(22,'','remaining essentially unchanged. It was popularised in the 1960s with the release of Letraset sheets containing Lorem Ipsum passages, and more recently with desktop publishing software like Aldus PageMaker including versions of Lorem Ipsum.','2020-09-08 09:52:00'),(23,'','t is a long established fact that a reader will be distracted by the readable content of a page when looking at its layout. The point of using Lorem Ipsum is that it has a more-or-less normal distribution of letters, as opposed to using \'Content here,','2020-09-08 09:52:08'),(24,'','content here\', making it look like readable English. Many desktop publishing packages and web page editors now use Lorem Ipsum as their default model text, and a search for \'lorem ipsum\' will uncover many web sites still in their infancy. ','2020-09-08 09:52:17'),(25,'Boc ceybank tested successfully','Various versions have evolved over the years, sometimes by accident, sometimes on purpose (injected humour and the like).','2020-09-08 09:52:28'),(26,'Boc ceybank tested successfully','Contrary to popular belief, Lorem Ipsum is not simply random text. It has roots in a piece of classical Latin literature from 45 BC, making it over 2000 years old. Richard McClintock,','2020-09-08 09:52:56'),(27,'Boc ceybank tested successfully','Boc ceybank tested successfully...!!!!!!','2020-09-17 13:52:14'),(28,'Boc ceybank tested successfully','hot offer! 20% discounts on CeyBank RESt from 01st Oct 2020 - 31st Nov 2020','2020-09-11 16:17:20'),(29,'Boc ceybank tested successfully','hot offer! 20% discounts on CeyBank RESt from 01st Oct 2020 - 31st Nov 2020','2020-09-14 12:08:05'),(30,'Hot News','aaaaaaaaaaaa bbbbbbbbbbbbb ///////////////','2020-09-17 14:32:25'),(31,'BBC News','AAAAAAAAAAAAAA BBBBBBBBBB bgbhhbbbbbbbhh','2020-09-17 15:30:17'),(32,'BOC News','hot offer! 20% discounts on CeyBank REST from 01st Oct 2020 - 31st Nov 2020\r\n','2020-09-18 08:33:42'),(33,'BOC News','hot offer! 20% discounts on CeyBank RESt from 01st Oct 2020 - 31st Nov 2020, hot offer! 20% discounts on CeyBank RESt from 01st Oct 2020 - 31st Nov 2020, hot offer! 20% discounts on CeyBank RESt from 01st Oct 2020 - 31st Nov 2020, hot offer! 20% discounts on CeyBank RESt from 01st Oct 2020 - 31st Nov 2020, hot offer! 20% discounts on CeyBank RESt from 01st Oct 2020 - 31st Nov 2020','2020-09-18 08:50:26'),(34,'BIG SALE!!!','A new offers are available from 9th October to 30th October.','2020-10-08 14:09:34');
